function numToHex( ks ){
    var hex = "";
    for(let  k of ks ){
       var c =  (k).toString(16)
        if(c.length==1){
            c = "0"+c;
        }
        hex = hex+c;
    }
    return hex;
}

const hls = new Hls({ enableWorker: false, debug: false }); 
const tsBuffer = [];
let errorTsList = [];
let _fragments = [];
let stopDownload = false;
let _tsThread = 32;
let isParseTS = false;
const decryptor = new AESDecryptor();
let keyContent = null;

/* mp4 */
function fixFileDuration(data, duration) {
    // duration = parseInt(duration);
    let mvhdBoxDuration = duration * 90000;
    function getBoxDuration(data, duration, index) {
        let boxDuration = "";
        index += 16;    //  16 timescale
        boxDuration += data[index].toString(16);
        boxDuration += data[++index].toString(16);
        boxDuration += data[++index].toString(16);
        boxDuration += data[++index].toString(16);
        boxDuration = parseInt(boxDuration, 16);
        boxDuration *= duration;
        return boxDuration;
    }
    for (let i = 0; i < data.length; i++) {
        // mvhd
        if (data[i] == 0x6D && data[i + 1] == 0x76 && data[i + 2] == 0x68 && data[i + 3] == 0x64) {
            mvhdBoxDuration = getBoxDuration(data, duration, i);   //  timescale
            i += 20;    // mvhd 20 duration
            data[i] = (mvhdBoxDuration & 0xFF000000) >> 24;
            data[++i] = (mvhdBoxDuration & 0xFF0000) >> 16;
            data[++i] = (mvhdBoxDuration & 0xFF00) >> 8;
            data[++i] = mvhdBoxDuration & 0xFF;
            continue;
        }
        // tkhd
        if (data[i] == 0x74 && data[i + 1] == 0x6B && data[i + 2] == 0x68 && data[i + 3] == 0x64) {
            i += 24;    // tkhd 24 duration
            data[i] = (mvhdBoxDuration & 0xFF000000) >> 24;
            data[++i] = (mvhdBoxDuration & 0xFF0000) >> 16;
            data[++i] = (mvhdBoxDuration & 0xFF00) >> 8;
            data[++i] = mvhdBoxDuration & 0xFF;
            continue;
        }
        // mdhd
        if (data[i] == 0x6D && data[i + 1] == 0x64 && data[i + 2] == 0x68 && data[i + 3] == 0x64) {
            let mdhdBoxDuration = getBoxDuration(data, duration, i);   //  timescale
            i += 20;    // mdhd 20 duration
            data[i] = (mdhdBoxDuration & 0xFF000000) >> 24;
            data[++i] = (mdhdBoxDuration & 0xFF0000) >> 16;
            data[++i] = (mdhdBoxDuration & 0xFF00) >> 8;
            data[++i] = mdhdBoxDuration & 0xFF;
            continue;
        }
        //  mdat  
        if (data[i] == 0x6D && data[i + 1] == 0x64 && data[i + 2] == 0x61 && data[i + 3] == 0x74) {
            return data;
        }
    }
    return data;
}


function parseTs(data) {
    _fragments = data.fragments;
    total = _fragments.length;
    isParseTS = true;
}

//  TS
function downloadTs(start = 0, end = _fragments.length - 1, errorObj = undefined) {
    let tsThread = 0;  // 
    let index = start - 1; // 
    let downTotalTs = end - start + 1;  // 
    let downloaded = 0;
    let fileSize = 0;
    const timeout = errorObj ? 0 : 30000;

    const ajaxDwnload = (fragment, currentIndex) => {
        $.ajax({
            url: fragment.url,
            xhrFields: { responseType: "arraybuffer" },
            timeout: timeout
        }).done(function (responseData) {
            try {
                decryptor.expandKey(keyContent.buffer);
                tsBuffer[currentIndex] = decryptor.decrypt(responseData, 0, fragment.levelkey.iv.buffer, true);
                fileSize += tsBuffer[currentIndex].byteLength;
                $fileSize.html(byteToSize(fileSize));
                $progressData.html(`${++downloaded}/${downTotalTs}`);
                if (downloaded === downTotalTs) {
                    $progressData.html(``);
                    mergeTs();
                    return
                }
            } catch (e) {
                return;
            }
        }).fail(function () {
            ajaxDwnload(fragment, currentIndex)
        });
    }

    _fragments.forEach(fragment => {
        let currentIndex = ++index;   // 
        ajaxDwnload(fragment, currentIndex);
    });

    // ajaxDwnload(_fragments[0], 0);
}

function mergeTs() {
    // 
    const _tsBuffer = [];
    for (let i = 0; i < tsBuffer.length; i++) {
        if (tsBuffer[i]) {
            _tsBuffer.push(tsBuffer[i]);
            tsBuffer[i] = undefined;
        }
        delete tsBuffer[i];
    }
    tsBuffer.splice(0);

    // 
    let fileBlob = new Blob(_tsBuffer, { type: "video/MP2T" });
    let ext = _fragments[0].url.split("/").pop();
    ext = ext.split("?")[0];
    ext = ext.split(".").pop();
    ext = ext ? ext : "ts";

    const transmuxer = new muxjs.mp4.Transmuxer({ remux: true });
    let headEncoding = true;
    let index;

    // 
    transmuxer.on('data', function (segment) {
        if (headEncoding) {
            headEncoding = false;
            let data = new Uint8Array(segment.initSegment.byteLength + segment.data.byteLength);
            data.set(segment.initSegment, 0);
            data.set(segment.data, segment.initSegment.byteLength);
            _tsBuffer[index] = fixFileDuration(data, 0);
            return;
        }
        _tsBuffer[index] = segment.data;
    });

    // ts
    for (index in _tsBuffer) {
        transmuxer.push(new Uint8Array(_tsBuffer[index]));
        transmuxer.flush();
    }

    // 
    transmuxer.off('data');

    //   mp4
    if (!headEncoding) {
        fileBlob = new Blob(_tsBuffer, { type: "video/mp4" });
        ext = "mp4";
    }
    delete transmuxer;

    // 
    let aTag = document.createElement('a');//a
    aTag.download = `${$('li.selected a').eq(0).attr('title')}.${ext}`;
    let href = URL.createObjectURL(fileBlob);//url
    aTag.href = href;
    aTag.click();
    URL.revokeObjectURL(href);//url

    $btnDownload.prop("disabled", false).css("cursor","pointer");
    $progress.hide();

    _tsBuffer.splice(0); 
    delete _tsBuffer;
}

// 
function byteToSize(byte) {
    if (!byte || byte < 1024) { return 0; }
    if (byte < 1024 * 1024) {
        return parseFloat((byte / 1024).toFixed(1)) + "KB";
    } else if (byte < 1024 * 1024 * 1024) {
        return parseFloat((byte / 1024 / 1024).toFixed(1)) + "MB";
    } else {
        return parseFloat((byte / 1024 / 1024 / 1024).toFixed(1)) + "GB";
    }
}

let $btnDownload = null;
let $progress = null;
let $progressData = null;
let $fileSize = null;

let downloaded = 0;
let total = 0;
let fileSize = 0;

function setSource(key,vi,m3u8){
    keyContent = key;
    console.log('--- setSource key = ', numToHex(key), 'vi = ', numToHex(vi));
    //  m3u8
    hls.loadSource(m3u8);
    // m3u8 
    hls.on(Hls.Events.MANIFEST_PARSED, function (event, data) {
        hls.on(Hls.Events.LEVEL_LOADED, function (event, data) {
            parseTs(data.details);  // Ts
        });
    });

    downloaded = 0;
    fileSize = 0;

    var $container = $(`
        <div id="container" style='position:absolute; z-index:9999; top: 80px; right:10px; padding: 10px; background: #fff; width:500px; height: 80px'>
            <button id="btnDownload" style="cursor: pointer"></button>
            <p id="progress" style="display: none;"><span id="process-data"></span>  <span id="file-size">${byteToSize(fileSize)}</span></p>
        </div>
    `);
    if($('#container').length === 0) {
        $("body").append($container);
        $btnDownload = $('#btnDownload');
        $progress = $('#progress');
        $progressData = $('#process-data');
        $fileSize = $('#file-size');

        $btnDownload.bind('click', () => {
            if (isParseTS) {
                $btnDownload.prop("disabled", true).css("cursor","no-drop");
                $progress.show();
                $progressData.html(`${downloaded}/${total}`);
                downloadTs();
            } else {
                alert('')
            }
        });
    }
}

